import React from "react";
import ReactDOM from "react-dom";

class Tile extends React.Component{
    constructor(props){
        super(props);
        };

    render() {
        return( <div 
            className={"tile"} 
            id={this.props.X , this.props.Y}>

                {`X ${this.props.X} - Y ${this.props.Y}`}

                </div>
            );
       };
    }

export default Tile;
